import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{r as i,o as a,c,a as e,b as n,d as l,e as r}from"./app-6706a352.js";const s={},g=e("p",null,[n("👨‍🎓"),e("strong",null,"博主简介")],-1),_={href:"https://blog.csdn.net/liu_chen_yang?type=blog",target:"_blank",rel:"noopener noreferrer"},d=e("br",null,null,-1),u={href:"https://bbs.huaweicloud.com/community/myblog",target:"_blank",rel:"noopener noreferrer"},p=e("br",null,null,-1),h={href:"https://developer.aliyun.com/my?spm=a2c6h.13148508.setting.3.21fc4f0eCmz1v3#/article?_k=zooqoz",target:"_blank",rel:"noopener noreferrer"},b=e("br",null,null,-1),f=e("strong",null,"交流社区：",-1),m={href:"https://bbs.csdn.net/forums/lcy",target:"_blank",rel:"noopener noreferrer"},y=e("br",null,null,-1),x=e("br",null,null,-1),I=r('<hr><h2 id="报错" tabindex="-1"><a class="header-anchor" href="#报错" aria-hidden="true">#</a> 报错</h2><p>开启虚拟机出现报错：此主机支持 Intel VT-x，但 Intel VT-x 处于禁用状态</p><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958064.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><blockquote><p>Intel VT-x完整名称是<code>Intel Virtualization Technology</code>，就是Intel虚拟技术，开启它可以让硬件平台同时运行多个操作系统，是虚拟机软件运行必备的技术之一，如果禁用，就会弹出“此主机支持Intel VT-x,但Intel VT-x处于禁用状态”这个提示，解决办法就是进BIOS开启Intel Virtualization Technology。</p></blockquote><h2 id="原因" tabindex="-1"><a class="header-anchor" href="#原因" aria-hidden="true">#</a> 原因</h2><p>原因是：电脑没有启用虚拟化</p><p>我们打开任务管理器，点击<code>“性能” ——&gt; “CPU”</code>，可以看到虚拟化是处于禁用状态的</p><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958232.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><h2 id="解决方式-这里以联想笔记本为例" tabindex="-1"><a class="header-anchor" href="#解决方式-这里以联想笔记本为例" aria-hidden="true">#</a> 解决方式（这里以联想笔记本为例）</h2><ul><li>1、重启电脑，开机时按“Fn+F2”，会听到滴的一声，进入BIOS界面</li></ul><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958492.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li>2、选择<code>“configuration”</code>，找到<code>“intel virtual technology”</code>，按回车，将“Disable（关闭）” 改为“Enable（打开）”</li></ul><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958031.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li><p>3、最后按<code>“Fn+F10”</code>保存并退出，重启即可。</p></li><li><p>4、重启完之后，进入windows页面，还是点击<code>“性能” ——&gt; “CPU”</code>，可以看到虚拟化已经处于启动状态了。</p></li></ul><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958669.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><ul><li>5、再次打开虚拟机，启动虚拟机成功。</li></ul><figure><img src="https://lcy-blog.oss-cn-beijing.aliyuncs.com/blog/202412200958326.png" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure>',18);function V(k,T){const o=i("ExternalLinkIcon");return a(),c("div",null,[e("blockquote",null,[g,e("p",null,[n("  🏅"),e("a",_,[n("云计算领域优质创作者"),l(o)]),d,n("   🏅"),e("a",u,[n("华为云开发者社区专家博主"),l(o)]),p,n("   🏅"),e("a",h,[n("阿里云开发者社区专家博主"),l(o)]),b,n(" 💊"),f,e("a",m,[n("运维交流社区"),l(o)]),n(" 欢迎大家的加入！"),y,n(" 🐋 希望大家多多支持，我们一起进步！😄"),x,n(" 🎉如果文章对你有帮助的话，欢迎 点赞 👍🏻 评论 💬 收藏 ⭐️ 加关注+💗")])]),I])}const v=t(s,[["render",V],["__file","开启虚拟机出现报错：“此主机支持 Intel VT-x，但 Intel VT-x 处于禁用状态”.html.vue"]]);export{v as default};
